import React, { useRef } from "react";
import "./search-bar.css";
import { Col, Form, FormGroup } from "reactstrap";

const SearchBar = ({ onSearch }) => {
  const locationRef = useRef("");
  const distanceRef = useRef("");
  const maxGroupSizeRef = useRef("");
  const ratingRef = useRef("");

  const SearchHandler = (e) => {
    e.preventDefault();

    const filters = {
      location: locationRef.current.value,
      distance: distanceRef.current.value,
      maxGroupSize: maxGroupSizeRef.current.value,
      rating: ratingRef.current.value,
    };

    onSearch(filters);
  };

  return (
    <Col lg="12">
      <div className="search__bar">
        <Form className="d-flex align-items-center gap-4" onSubmit={SearchHandler}>
          <FormGroup className="d-flex gap-3 form__group form__group-fast">
            <span>
              <i className="ri-map-pin-line"></i>
            </span>
            <div>
              <h6>Location</h6>
              <input type="text" placeholder="Where do you plan to go?" ref={locationRef}></input>
            </div>
          </FormGroup>
          <FormGroup className="d-flex gap-3 form__group form__group-fast">
            <span>
              <i className="ri-map-pin-time-line"></i>
            </span>
            <div>
              <h6>Distance (KM)</h6>
              <input type="number" placeholder="Distance KMs" ref={distanceRef}></input>
            </div>
          </FormGroup>
          <FormGroup className="d-flex gap-3 form__group form__group-fast">
            <span>
              <i className="ri-group-fill"></i>
            </span>
            <div>
              <h6>Max People</h6>
              <input type="number" placeholder="Number of people" ref={maxGroupSizeRef}></input>
            </div>
          </FormGroup>
          <FormGroup className="d-flex gap-3 form__group form__group-last">
            <span>
              <i className="ri-star-fill"></i>
            </span>
            <div>
              <h6>Minimum Rating</h6>
              <input type="number" placeholder="Rating (1-5)" ref={ratingRef}></input>
            </div>
          </FormGroup>
          <span className="search__icon" type="submit" onClick={SearchHandler}>
            <i className="ri-search-line"></i>
          </span>
        </Form>
      </div>
    </Col>
  );
};

export default SearchBar;
